import React from 'react';
import {Link} from 'react-router-dom';
import '../styles/Nav.css';

function Navbar(){
  return(

    <nav>
      <h1>blm</h1>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/products">Products</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
